import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";
import { BrowserRouter } from "react-router-dom";

import { Provider } from "react-redux";
import { createStore, subscribe, dispatch, combineReducers } from "redux";
import Check from "./redux/Check";
const initialUserState = {
  uid: null
};

const reducer = function(state = initialUserState, action) {
  switch (action.type) {
    case "UID":
      return { ...state, uid: payload };   
      break;

    default:
      return state;
      break;
  }
};
const store = createStore(
  reducer,
  [],
  window.devToolsExtension && window.devToolsExtension()
);

store.subscribe(() => {});

store.dispatch({ type: "ATTACK", payload: "A" });
store.dispatch({ type: "ATTACK", payload: "TH" });
store.dispatch({ type: "ATTACK", payload: "AR" });
store.dispatch({ type: "ATTACK", payload: "VA" });

ReactDOM.render(
  <BrowserRouter>
    <Provider store={store}>
      <App />
    </Provider>
  </BrowserRouter>,
  document.getElementById("root")
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
